import React, { useState } from 'react';

const Gallery = () => {
  const [selectedCategory, setSelectedCategory] = useState('all');
  const [searchTerm, setSearchTerm] = useState('');

  const exercises = [
    {
      id: 1,
      title: "Push-ups",
      category: "chest",
      difficulty: "beginner",
      equipment: "none",
      image: "https://via.placeholder.com/400x300/28a745/ffffff?text=Push-ups",
      description: "Classic upper body exercise targeting chest, shoulders, and triceps."
    },
    {
      id: 2,
      title: "Squats",
      category: "legs",
      difficulty: "beginner",
      equipment: "none",
      image: "https://via.placeholder.com/400x300/20c997/ffffff?text=Squats",
      description: "Fundamental lower body exercise for quads, glutes, and hamstrings."
    },
    {
      id: 3,
      title: "Pull-ups",
      category: "back",
      difficulty: "intermediate",
      equipment: "bar",
      image: "https://via.placeholder.com/400x300/17a2b8/ffffff?text=Pull-ups",
      description: "Advanced upper body exercise for back and biceps development."
    },
    {
      id: 4,
      title: "Deadlifts",
      category: "full-body",
      difficulty: "advanced",
      equipment: "barbell",
      image: "https://via.placeholder.com/400x300/dc3545/ffffff?text=Deadlifts",
      description: "Compound exercise targeting multiple muscle groups."
    },
    {
      id: 5,
      title: "Plank",
      category: "core",
      difficulty: "beginner",
      equipment: "none",
      image: "https://via.placeholder.com/400x300/ffc107/000000?text=Plank",
      description: "Core strengthening exercise for abs and stability."
    },
    {
      id: 6,
      title: "Lunges",
      category: "legs",
      difficulty: "beginner",
      equipment: "none",
      image: "https://via.placeholder.com/400x300/6f42c4/ffffff?text=Lunges",
      description: "Unilateral leg exercise for balance and strength."
    },
    {
      id: 7,
      title: "Bench Press",
      category: "chest",
      difficulty: "intermediate",
      equipment: "barbell",
      image: "https://via.placeholder.com/400x300/e83e8c/ffffff?text=Bench+Press",
      description: "Primary chest exercise with barbell or dumbbells."
    },
    {
      id: 8,
      title: "Shoulder Press",
      category: "shoulders",
      difficulty: "intermediate",
      equipment: "dumbbells",
      image: "https://via.placeholder.com/400x300/6610f2/ffffff?text=Shoulder+Press",
      description: "Overhead press for shoulder development."
    },
    {
      id: 9,
      title: "Bicep Curls",
      category: "arms",
      difficulty: "beginner",
      equipment: "dumbbells",
      image: "https://via.placeholder.com/400x300/007bff/ffffff?text=Bicep+Curls",
      description: "Isolation exercise for bicep development."
    }
  ];

  const categories = ['all', 'chest', 'back', 'legs', 'shoulders', 'arms', 'core', 'full-body'];

  const filteredExercises = exercises.filter(exercise => {
    const matchesCategory = selectedCategory === 'all' || exercise.category === selectedCategory;
    const matchesSearch = exercise.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         exercise.description.toLowerCase().includes(searchTerm.toLowerCase());
    return matchesCategory && matchesSearch;
  });

  const getDifficultyColor = (difficulty) => {
    switch(difficulty) {
      case 'beginner': return 'text-success';
      case 'intermediate': return 'text-warning';
      case 'advanced': return 'text-danger';
      default: return 'text-secondary';
    }
  };

  return (
    <>
      {/* Hero Section */}
      <section className="hero-section text-white text-center py-5 position-relative" 
             style={{ background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)' }}>
        <div className="hero-overlay"></div>
        <div className="container position-relative" style={{ zIndex: 2 }}>
          <h1 className="display-4 fw-bold mb-4 animate-fade-in">
            Exercise Gallery
          </h1>
          <p className="lead mb-4 animate-slide-up">
            Explore our comprehensive collection of exercises for all fitness levels
          </p>
        </div>
      </section>

      {/* Gallery Section */}
      <section className="py-5">
        <div className="container">
          {/* Filters */}
          <div className="row mb-4">
            <div className="col-md-6">
              <div className="input-group">
                <span className="input-group-text">
                  <i className="fas fa-search"></i>
                </span>
                <input
                  type="text"
                  className="form-control"
                  placeholder="Search exercises..."
                  value={searchTerm}
                  onChange={(e) => setSearchTerm(e.target.value)}
                />
              </div>
            </div>
            <div className="col-md-6">
              <select
                className="form-select"
                value={selectedCategory}
                onChange={(e) => setSelectedCategory(e.target.value)}
              >
                {categories.map(category => (
                  <option key={category} value={category}>
                    {category.charAt(0).toUpperCase() + category.slice(1).replace('-', ' ')}
                  </option>
                ))}
              </select>
            </div>
          </div>

          {/* Exercise Grid */}
          <div className="row">
            {filteredExercises.map(exercise => (
              <div key={exercise.id} className="col-lg-4 col-md-6 mb-4">
                <div className="card h-100 shadow-sm exercise-card">
                  <img 
                    src={exercise.image} 
                    className="card-img-top" 
                    alt={exercise.title}
                    style={{ height: '200px', objectFit: 'cover' }}
                  />
                  <div className="card-body">
                    <h5 className="card-title">{exercise.title}</h5>
                    <p className="card-text">{exercise.description}</p>
                    <div className="d-flex justify-content-between align-items-center">
                      <span className={`badge bg-secondary me-2`}>
                        <i className="fas fa-tag me-1"></i>
                        {exercise.category}
                      </span>
                      <span className={`badge ${getDifficultyColor(exercise.difficulty)}`}>
                        <i className="fas fa-signal me-1"></i>
                        {exercise.difficulty}
                      </span>
                    </div>
                    <div className="mt-2">
                      <small className="text-muted">
                        <i className="fas fa-tools me-1"></i>
                        {exercise.equipment === 'none' ? 'No Equipment' : exercise.equipment}
                      </small>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>

          {filteredExercises.length === 0 && (
            <div className="text-center py-5">
              <i className="fas fa-search fa-3x text-muted mb-3"></i>
              <h4>No exercises found</h4>
              <p className="text-muted">
                Try adjusting your search or category filter
              </p>
            </div>
          )}
        </div>
      </section>

      <style jsx>{`
        .exercise-card {
          transition: transform 0.3s ease, box-shadow 0.3s ease;
        }
        .exercise-card:hover {
          transform: translateY(-5px);
          box-shadow: 0 10px 25px rgba(0, 0, 0, 0.15);
        }
      `}</style>
    </>
  );
};

export default Gallery;
